package org.tron.core.vm.config;

import org.tron.common.utils.ByteArray;
import org.tron.common.utils.Sha256Hash;

public class GatewayCode {

  public static final String gatewayCode = new StringBuilder(
      "")
      .append(
          "")
      .toString();

  public static String codeHash() {
    return ByteArray.toHexString(Sha256Hash.hash(true,gatewayCode.getBytes()));
  }
}
